import React from 'react';

function Awards() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-6'>
                    <div className='col-6'>
                        <img src='media/largestBroker.svg'/> 
                    </div>
                </div>
            </div>
        </div>
     );
}

export default Awards;
